  summary: "\nThe value of a qualifiable element may be further qualified by one or more\nqualifiers.\n"
  remarks: "\n<p>\nConstraints:\n</p>\n<ul>\n<li>\n  Constraint AASd-119:\n  If any <xref href=\"AasCore.Aas3_0_RC02.Qualifier.Kind\" data-throw-if-not-resolved=\"false\"></xref> value of <xref href=\"AasCore.Aas3_0_RC02.IQualifiable.Qualifiers\" data-throw-if-not-resolved=\"false\"></xref> is\n  equal to <xref href=\"AasCore.Aas3_0_RC02.QualifierKind.TemplateQualifier\" data-throw-if-not-resolved=\"false\"></xref> and the qualified element\n  inherits from <xref href=\"AasCore.Aas3_0_RC02.IHasKind\" data-throw-if-not-resolved=\"false\"></xref> then the qualified element shall be of\n  kind Template (<xref href=\"AasCore.Aas3_0_RC02.IHasKind.Kind\" data-throw-if-not-resolved=\"false\"></xref> = <xref href=\"AasCore.Aas3_0_RC02.ModelingKind.Template\" data-throw-if-not-resolved=\"false\"></xref>).\n</li>\n</ul>\n"
